import React from 'react';
import SideMenu from '../Components/SideMenu';
import './App.css';
import '../TanteAdmin/Components/SideMenu';
import {
  CssBaseline,
  makeStyles,
  createMuiTheme,
  ThemeProvider,
} from '@material-ui/core';
import Header from '../TanteAdmin/Components/Header';

import Employees from '../Pages/Employees/Employees';

const theme = createMuiTheme({
  palette: {
    primary: {
      main: '#2B3053',
      light: '#3c44b126',
    },
    secondary: {
      main: '#f83245',
      light: '#f8324526',
    },
    background: {
      default: '#f4f5fd',
    },
  },
  overrides: {
    MuiAppBar: {
      root: {
        transform: 'translateZ(0)',
      },
    },
  },
  props: {
    MuiIconButton: {
      disableRipple: true,
    },
  },
  shape: {
    borderRadius: '5px',
  },
});

const useStyles = makeStyles({
  appMain: {
    paddingLeft: '320px',
    width: '100%',
  },
});
function AdminScreen() {
  const classes = useStyles();
  return (
    <ThemeProvider theme={theme}>
      <React.Fragment>
        <SideMenu />
        <div className={classes.appMain}>
          <Header />

          <Employees />
        </div>

        <CssBaseline />
      </React.Fragment>
    </ThemeProvider>
  );
}

export default AdminScreen;
